import React from 'react'
import useMenus from '../data/useMenus'


const MenusPrimary = () => {
    var menuData = '';
    const menusInfo = useMenus();
    menusInfo.map(item => (
        menuData = item
    ))
    if (menuData.length > 0 ) {
        return (
            menuData.map(item => (
                <div className='' key={item.id}>
                    {
                        item.locations == "PRIMARY" ? (
                            <ul>
                                <li>{item.uri}</li>
                            </ul>
                        ) : null
                    }
                </div>
            ))
        )
    }
}

export default MenusPrimary
